  return (
    <Router>
      <div className="app">
        <Routes>
          <Route path="/checkout"/>
            <h1>Checkout</h1>
          <Route path="/login"/>
            <h1>Login page</h1>

          <Route path="/"/>
            <h1>homepage</h1>
        </Routes>
      </div>
    </Router>

  );
}

export default App;
